import React from 'react';
import './App.css';
function Weather() {
  return (
    <div className="weather-container">
      <h1>Today's weather is:</h1>
      {/* Add additional weather information or functionality here */}
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Schneider Truck</h1>
      </header>
      <nav className="App-nav">
        <button onClick={() => window.location.href="/destination"} className="nav-button">Enter Your Destination</button>
        <button onClick={() => window.location.href="/report"} className="nav-button">Report Time</button>
        <button onClick={() => window.location.href="/weather"} className="nav-button">Weather Today</button>
        <button onClick={() => window.location.href="/about_us"} className="nav-button">About US</button>
        <button onClick={() => window.location.href="/community_tips"} className="nav-button">Community Tips</button>
        <button onClick={() => window.location.href="/driving_summary"} className="nav-button">Driving Summary</button>
        <button onClick={() => window.location.href="/community_support"} className="nav-button">Community Support</button>
      </nav>
    </div>
  );
}

export default App;
